// ==UserScript==
// @name         yuque-html-exporter
// @namespace    https://github.com/zenonux
// @version      1.5
// @description  export yueque document to html.
// @author       换个头像心好累
// @license      GPL-3.0 License
// @match        *://*.yuque.com/*
// @icon         data:image/svg+xml;base64,
// @grant        none
// ==/UserScript==

(function () {
  "use strict";
  _showExportButton('html');
  function _showExportButton(str) {
    let btn = document.createElement("button");
    btn.innerText = "导出html";
    btn.style =
      "position:fixed;top:16%;left:50%;transform:translate(-50%,0);z-index:10000;background:#888;padding:10px 14px;border:none;color:#fff;cursor:pointer;";
    btn.addEventListener("click", () => {
      _copyToClipboard(str).then(() => {
        _showToast("已导出至剪切板");
      });
    });
    document.body.appendChild(btn);
  }
  function _showToast(msg) {
    let toast = document.createElement("div");
    toast.innerText = msg;
    toast.style =
      "position:fixed;top:16%;left:50%;transform:translate(-50%,-24%);z-index:20000;background:#67C23A;padding:30px 45px;border-radius:4px;color:#fff;";
    document.body.appendChild(toast);
    setTimeout(() => {
      document.body.removeChild(toast);
    }, 1000);
  }
  function _copyToClipboard(text) {
    return navigator.clipboard.writeText(text);
  }
})();
